import React, { useState } from "react";
import { Anomaly } from "../types/insights";
import {
  AlertTriangle,
  TrendingUp,
  GitBranch,
  Zap,
  ChevronDown,
  ChevronRight,
  Link2,
  ArrowRight,
  Container,
  Server,
  Database,
  Shield,
  Layers,
  Timer,
  Gauge,
  Activity,
  Target,
  Network,
} from "lucide-react";

interface AnomaliesTableProps {
  anomalies: Anomaly[];
}

const AnomaliesTable: React.FC<AnomaliesTableProps> = ({ anomalies }) => {
  const [expandedRows, setExpandedRows] = useState<Set<string>>(new Set());
  const [filterSeverity, setFilterSeverity] = useState<string>("all");
  const [filterType, setFilterType] = useState<string>("all");

  const toggleRow = (id: string) => {
    const newExpanded = new Set(expandedRows);
    if (newExpanded.has(id)) {
      newExpanded.delete(id);
    } else {
      newExpanded.add(id);
    }
    setExpandedRows(newExpanded);
  };

  const getSeverityColor = (severity: string) => {
    switch (severity) {
      case "critical":
        return "bg-red-100 text-red-800 border-red-200";
      case "high":
        return "bg-orange-100 text-orange-800 border-orange-200";
      case "medium":
        return "bg-yellow-100 text-yellow-800 border-yellow-200";
      case "low":
        return "bg-blue-100 text-blue-800 border-blue-200";
      default:
        return "bg-gray-100 text-gray-800 border-gray-200";
    }
  };

  const getTypeIcon = (type: string) => {
    switch (type) {
      case "burst_correlation":
        return <Activity className="h-5 w-5" />;
      case "lead_lag":
        return <ArrowRight className="h-5 w-5" />;
      case "pmi_correlation":
        return <Link2 className="h-5 w-5" />;
      case "change_attribution":
        return <Target className="h-5 w-5" />;
      default:
        return <AlertTriangle className="h-5 w-5" />;
    }
  };

  const getTypeColor = (type: string) => {
    switch (type) {
      case "burst_correlation":
        return "text-blue-600 bg-blue-50";
      case "lead_lag":
        return "text-green-600 bg-green-50";
      case "pmi_correlation":
        return "text-purple-600 bg-purple-50";
      case "change_attribution":
        return "text-orange-600 bg-orange-50";
      default:
        return "text-gray-600 bg-gray-50";
    }
  };

  const getTypeLabel = (type: string) => {
    switch (type) {
      case "burst_correlation":
        return "Burst Correlation";
      case "lead_lag":
        return "Lead-Lag Relationship";
      case "pmi_correlation":
        return "PMI Co-occurrence";
      case "change_attribution":
        return "Change Attribution";
      default:
        return "Unknown";
    }
  };

  const formatTypeLabel = (type: string) => {
    switch (type) {
      case "burst_correlation":
        return "Burst Correlation";
      case "lead_lag":
        return "Lead-Lag";
      case "pmi_correlation":
        return "PMI Co-occurrence";
      case "change_attribution":
        return "Change Attribution";
      default:
        return type;
    }
  };

  const filteredAnomalies = anomalies.filter((anomaly) => {
    const severityMatch =
      filterSeverity === "all" || anomaly.severity === filterSeverity;
    const typeMatch = filterType === "all" || anomaly.type === filterType;
    return severityMatch && typeMatch;
  });

  const renderDetails = (anomaly: Anomaly) => {
    const details = anomaly.details;

    switch (anomaly.type) {
      case "burst_correlation":
        return (
          <div className="grid grid-cols-2 gap-4 text-sm">
            <div>
              <span className="font-medium">Correlation:</span>{" "}
              {details.correlation?.toFixed(3)}
            </div>
            <div>
              <span className="font-medium">P-value:</span>{" "}
              {details.p_value?.toExponential(2)}
            </div>
            <div>
              <span className="font-medium">Aligned Bursts:</span>{" "}
              {details.aligned_bursts}
            </div>
            <div>
              <span className="font-medium">Sample Size:</span>{" "}
              {details.sample_size}
            </div>
            <div className="col-span-2">
              <span className="font-medium">Confidence Interval:</span> [
              {details.confidence_interval?.[0]?.toFixed(3)},{" "}
              {details.confidence_interval?.[1]?.toFixed(3)}]
            </div>
          </div>
        );

      case "lead_lag":
        return (
          <div className="grid grid-cols-2 gap-4 text-sm">
            <div>
              <span className="font-medium">Lag:</span> {details.lag_seconds}s (
              {details.direction})
            </div>
            <div>
              <span className="font-medium">Correlation:</span>{" "}
              {details.correlation?.toFixed(3)}
            </div>
            <div>
              <span className="font-medium">Granger Score:</span>{" "}
              {details.granger_score?.toFixed(3)}
            </div>
            <div>
              <span className="font-medium">Confidence:</span>{" "}
              {details.confidence?.toFixed(3)}
            </div>
          </div>
        );

      case "pmi_correlation":
        return (
          <div className="grid grid-cols-2 gap-4 text-sm">
            <div>
              <span className="font-medium">PMI Score:</span>{" "}
              {details.pmi_score?.toFixed(2)}
            </div>
            <div>
              <span className="font-medium">Support:</span> {details.support}
            </div>
            <div>
              <span className="font-medium">Confidence:</span>{" "}
              {details.confidence?.toFixed(3)}
            </div>
            <div>
              <span className="font-medium">Total Buckets:</span>{" "}
              {details.total_buckets}
            </div>
          </div>
        );

      case "change_attribution":
        return (
          <div className="grid grid-cols-2 gap-4 text-sm">
            <div>
              <span className="font-medium">Correlation:</span>{" "}
              {details.correlation_coefficient?.toFixed(3)}
            </div>
            <div>
              <span className="font-medium">Lag:</span>{" "}
              {details.lag_minutes?.toFixed(1)} min
            </div>
            <div>
              <span className="font-medium">Change Count:</span>{" "}
              {details.change_count}
            </div>
            <div>
              <span className="font-medium">Effect Count:</span>{" "}
              {details.effect_count}
            </div>
          </div>
        );

      default:
        return (
          <pre className="text-xs bg-gray-50 p-2 rounded overflow-auto">
            {JSON.stringify(details, null, 2)}
          </pre>
        );
    }
  };

  return (
    <div className="space-y-4">
      {/* Filters */}
      <div className="flex flex-wrap gap-4">
        <div>
          <label className="block text-sm font-medium text-gray-700 mb-1">
            Severity
          </label>
          <select
            value={filterSeverity}
            onChange={(e) => setFilterSeverity(e.target.value)}
            className="border border-gray-300 rounded-md px-3 py-1 text-sm focus:outline-none focus:ring-2 focus:ring-blue-500"
          >
            <option value="all">All Severities</option>
            <option value="critical">Critical</option>
            <option value="high">High</option>
            <option value="medium">Medium</option>
            <option value="low">Low</option>
          </select>
        </div>

        <div>
          <label className="block text-sm font-medium text-gray-700 mb-1">
            Type
          </label>
          <select
            value={filterType}
            onChange={(e) => setFilterType(e.target.value)}
            className="border border-gray-300 rounded-md px-3 py-1 text-sm focus:outline-none focus:ring-2 focus:ring-blue-500"
          >
            <option value="all">All Types</option>
            <option value="burst_correlation">Burst Correlation</option>
            <option value="lead_lag">Lead-Lag</option>
            <option value="pmi_correlation">PMI Co-occurrence</option>
            <option value="change_attribution">Change Attribution</option>
          </select>
        </div>
      </div>

      {/* Table */}
      <div className="overflow-hidden border border-gray-200 rounded-lg">
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Anomaly
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Type
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Severity
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Time
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Details
              </th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            {filteredAnomalies.map((anomaly) => (
              <React.Fragment key={anomaly.id}>
                <tr className="hover:bg-gray-50">
                  <td className="px-6 py-4">
                    <div className="text-sm text-gray-900 max-w-md">
                      {anomaly.message}
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <div
                      className={`flex items-center ${getTypeColor(
                        anomaly.type
                      )}`}
                    >
                      {getTypeIcon(anomaly.type)}
                      <span className="ml-2 text-sm font-medium">
                        {formatTypeLabel(anomaly.type)}
                      </span>
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <span
                      className={`inline-flex px-2 py-1 text-xs font-semibold rounded-full border ${getSeverityColor(
                        anomaly.severity
                      )}`}
                    >
                      {anomaly.severity}
                    </span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                    {new Date(anomaly.timestamp).toLocaleTimeString()}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <button
                      onClick={() => toggleRow(anomaly.id)}
                      className="text-blue-600 hover:text-blue-800 flex items-center"
                    >
                      {expandedRows.has(anomaly.id) ? (
                        <ChevronDown className="h-4 w-4" />
                      ) : (
                        <ChevronRight className="h-4 w-4" />
                      )}
                      <span className="ml-1 text-sm">Details</span>
                    </button>
                  </td>
                </tr>
                {expandedRows.has(anomaly.id) && (
                  <tr>
                    <td colSpan={5} className="px-6 py-4 bg-gray-50">
                      {renderDetails(anomaly)}
                    </td>
                  </tr>
                )}
              </React.Fragment>
            ))}
          </tbody>
        </table>

        {filteredAnomalies.length === 0 && (
          <div className="text-center py-8 text-gray-500">
            No anomalies match the current filters.
          </div>
        )}
      </div>
    </div>
  );
};

export default AnomaliesTable;
